import React, { useState } from 'react'
import styles from './ItensLista.module.css'

export default function ItensLista({onChange, onDelete, metodo, juros, onChangeJuros,ativo}) {
  const [estado, setEstado] = useState(false)

  const alteracao = () => {
    setEstado(!estado)
    ativo = estado
  }
  return (
    <div className={styles.container}>
        Metodo:
        <input className={styles.input} value={metodo} />
        Juros:
        <input className={styles.input} value={juros} />
        {/* <button onClick={onDelete}>Deletar</button> */}
        Ativo:
        <input value={estado} onClick={alteracao} type='checkbox'/>
    </div>
  )
}
